import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

const NavigationBar = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" sticky="top" className="navbar-custom">
      <Navbar.Brand href="#home">Starfires V2</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#link">Stargate</Nav.Link>
          <Nav.Link href="#link">Library</Nav.Link>
          <Nav.Link href="#link">Treasures</Nav.Link>
          <Nav.Link href="#link">Mastery</Nav.Link>
          <Nav.Link href="#link">Consultations</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default NavigationBar;
